import React from "react";
import Layout from "../../components/Layout/Layout";

const Register = () => {
  return (
    <>
      <Layout title="Register E-commerce">
        <div className="register">
          <h1>Register</h1>
        </div>
      </Layout>
    </>
  );
};

export default Register;
